import React, { useState, useEffect } from 'react';
import { Form, Button, ListGroup } from 'react-bootstrap';
import axios from 'axios';

const Atividades = () => {
  const [atividade, setAtividade] = useState({
    tipoAtividade: '',
    dataAtividade: '',
    duracao: '',
    distancia: '',
    intensidade: '',
    caloriasQueimadas: '',
    observacoes: '',
  });

  const [atividades, setAtividades] = useState([]);

  const fetchAtividades = async () => {
    try {
      const response = await axios.get('http://localhost:3000/api/atividades'); 
      setAtividades(response.data);
    } catch (error) {
      console.error('Erro ao buscar atividades:', error);
    }
  };

  useEffect(() => {
    fetchAtividades();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setAtividade((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Enviar dados para a API para registrar a nova atividade
      await axios.post('https://sua-api.com/atividades', atividade); // Substitua pela URL da sua API
      setAtividades([...atividades, atividade]); // Adiciona a nova atividade ao estado local
      setAtividade({ tipoAtividade: '', dataAtividade: '', duracao: '', distancia: '', intensidade: '', caloriasQueimadas: '', observacoes: '' }); // Limpa o formulÃ¡rio
    } catch (error) {
      console.error('Erro ao registrar atividade:', error);
    }
  };

  return (
    <div>
      <h2>Registrar Atividade</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group>
          <Form.Label>Tipo de Atividade</Form.Label>
          <Form.Control 
            type="text" 
            name="tipoAtividade" 
            value={atividade.tipoAtividade} 
            onChange={handleChange} 
            placeholder="Digite o tipo de atividade" 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Data da Atividade</Form.Label>
          <Form.Control 
            type="date" 
            name="dataAtividade" 
            value={atividade.dataAtividade} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>DuraÃ§Ã£o (minutos)</Form.Label>
          <Form.Control 
            type="number" 
            name="duracao" 
            value={atividade.duracao} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>DistÃ¢ncia (km)</Form.Label>
          <Form.Control 
            type="number" 
            name="distancia" 
            value={atividade.distancia} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Intensidade</Form.Label>
          <Form.Control 
            type="text" 
            name="intensidade" 
            value={atividade.intensidade} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Calorias Queimadas</Form.Label>
          <Form.Control 
            type="number" 
            name="caloriasQueimadas" 
            value={atividade.caloriasQueimadas} 
            onChange={handleChange} 
            required 
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>ObservaÃ§Ãµes</Form.Label>
          <Form.Control 
            as="textarea" 
            name="observacoes" 
            value={atividade.observacoes} 
            onChange={handleChange} 
            placeholder="ObservaÃ§Ãµes" 
          />
        </Form.Group>
        <Button type="submit">Adicionar</Button>
      </Form>

      <ListGroup className="mt-3">
        {atividades.map((item, index) => (
          <ListGroup.Item key={index}>
            {`${item.tipoAtividade} - ${item.dataAtividade} - ${item.duracao}min - ${item.distancia}km - ${item.intensidade} - ${item.caloriasQueimadas} cal`}
            {item.observacoes && <div><strong>ObservaÃ§Ãµes:</strong> {item.observacoes}</div>}
          </ListGroup.Item>
        ))}
      </ListGroup>
    </div>
  );
};

export default Atividades;
